Q==","owner":{"id":"1133004","username":"jcomparel"},"is_video":false,"accessibility_caption":"Photo shared by Jonny Comparelli on January 03, 2021 tagging @jmprocreative. May be an image of one or more people, people standing and outerwear.","edge_media_to_caption":{"edges":[{"node":{"text":"See ya 2020! \u270c\ufe0fyou were a year that brought a lot of change in all of our lives and for the most part, it\u2019s been difficult and uncomfortable. As hard as this past year has been for all of us though, I\u2019m thankful because it\u2019s been a lesson in reflection and helped me discover how grateful I am for the memories of the past and more importantly how much I appreciate my family, friends and ones I love.\n\nAt the beginning of 2020, @mmuralla and I closed a 10 year chapter in our lives with the end of the show, it just so happened to coincide with a global pandemic. \n\nAs difficult as it was to say goodbye to something we worked so hard to bring to life, it\u2019s given me the opportunity to take a break from the chaos that came along with running a business and hosting the show.  A break I otherwise would have never taken for myself. It\u2019s hard to put into words how much of a void there\u2019s been without the qriket family. \n\nOver the last few years I was a bit too caught up with the pursuit of success - or really, the idea I had in my head of what success looked like. Looking back on it now, so many of the stresses in my life before this year and the bad habits that came along with them came from this hidden pressure. And although I can recognize that some of this pressure contributed to all the great things we were able to do, I lost touch with some of the things that really mattered.  My passion and love of bringing positivity to you all everyday made me fearful of sharing the experiences we had when things weren\u2019t going so well.\n\nI love you and I\u2019m incredibly thankful that 2020 gave me the time I needed to step back and reconnect. The team and I have bigger and better things on the horizon and I can\u2019t wait to share them with all of you when the time is right.\n\nStay groovy \ud83d\udc7d\ud83d\udd30\nJC"}}]},"edge_media_to_comment":{"count":76},"comments_disabled":false,"taken_at_timestamp":1609710912,"edge_liked_by":{"count":433},"edge_media_preview_like":{"count":433},"location":null,"thumbnail_src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/sh0.08/e35/c0.180.1440.1440a/s640x640/135425718_3571864882899175_5283130753065570445_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=K-YjjEbyVNgAX9aB-kq\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=9a05470ee69390ce1c92c16963d28671\u0026oe=609551DF\u0026_nc_sid=7bff83","thumbnail_resources":[{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s150x150/135425718_3571864882899175_5283130753065570445_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=K-YjjEbyVNgAX9aB-kq\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=1251934b90361061f3b2b7fcd7a450e8\u0026oe=6092C072\u0026_nc_sid=7bff83","config_width":150,"config_height":150},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s240x240/135425718_3571864882899175_5283130753065570445_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=K-YjjEbyVNgAX9aB-kq\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=1397fbf8ff40e30b81250567ae35c1c0\u0026oe=6094C8FA\u0026_nc_sid=7bff83","config_width":240,"config_height":240},{"src":"https://instagram.feoh5-1.fna.fbcdn.net/v/t51.2885-15/e35/c0.180.1440.1440a/s320x320/135425718_3571864882899175_5283130753065570445_n.jpg?tp=1\u0026_nc_ht=instagram.feoh5-1.fna.fbcdn.net\u0026_nc_cat=107\u0026_nc_ohc=K-YjjEbyVNgAX9aB-kq\u0026edm=ABfd0MgAAAAA\u0026ccb=7-4\u0026oh=94311536f0c4b6f7d8d727fd23fe9986\u0026oe=60948CA7\u0026_nc_sid=7bff83","config_width":320,"config_height":320},{"src":"https://instagram.feoh5-1.fna.fbcd
